import React from 'react';
import { Link } from 'react-router-dom';
import '../Styles/Navigationbr.css';
import leftImage from '../Assets/left-image.png'; // Replace with your actual image path
import rightImage from '../Assets/right-image.png'; // Replace with your actual image path

export default function Navigationbr() {
  return (
    <div>
      {/* Navigation Bar */}
      <nav className="navbar">
        <img src={leftImage} alt="Left" className="nav-image left-image" />
        <ul className="nav-links">
          <li><Link to="/Home" className="nav-link">Home</Link></li>
          <li><Link to="/Aboutus" className="nav-link">About Us</Link></li>
          <li><Link to="/Contactus" className="nav-link">Contact Us</Link></li>
          <li><Link to="/Careers" className="nav-link">Careers</Link></li>
          <li><Link to="/Login" className="nav-link">Login</Link></li>	
        </ul>
        <img src={rightImage} alt="Right" className="nav-image right-image" />
      </nav>
    </div>
  );
}
